        [Test]
        [TestCase("", "da39a3ee5e6b4b0d3255bfef95601890afd80709", TestName = "SHA-1 - 1")]
        [TestCase("c0fabb1f2dc66055", "b137b2b7a60e8d2f0552d0ddc3dc960245fffe6a", TestName = "SHA-1 - 2")]
        [TestCase("", "fd7f2c5502a682eaf2977d7d12cc1616feb97c3e", TestName = "SHA-1 - 3")]
        public void ShouldSHA1HashCorrectly(string messageHex, string digestHex)
        {
            var expectedDigest = new BitString(digestHex);

            var hashFunction = new HashFunction(ModeValues.SHA1, DigestSizes.d160);

            var sha = _subject.GetShaInstance(hashFunction);

            var result = sha.HashMessage(new BitString(messageHex));
            
            Assert.AreEqual(expectedDigest.ToHex(), result.Digest.ToHex());
        }

        
